![A well preserved Bouma sequence from Tabernas Basin, Spain. [reddit
link](https://www.reddit.com/r/geology/comments/b2yv4w/thought_you_guys_would_appreciate_this_almost/)](media/bouma_sequence.jpg){height="600px"}

# Introduction

The layered mud in the image above depicts a Bouma sequence, which to the untrained eye,
is... whatever man, it's mud. To the trained eye however, it is a dead giveaway that the
sediment was deposited by a series of dramatic submarine landslides, on the steep
continental shelf of a convergent tectonic margin. 

It is *not* a river, says the trained eye, it is *not* a delta, it is *not* a lake. It
is a [turbidite](https://en.wikipedia.org/wiki/Turbidite).

My favourite aspect of studying Geology was field work. I found it exciting that so much
information about a depositional system could be derived from outcrop and core scale
observations. It is a peculiar thing to make such strong inferences about systems that
existed millions of years in the past, that we can never verify, and its inevitable that
arguments over particular interpretations will occur. 

Bayesians don't argue about the truth though---they just agree to share it around to the
best candidates.

Coming at this from a bayesian perspective then, it seems like there should be a
framework for creating a distribution over geological interpretations. Speaking about
sedimentary sequences specifically, I think there are tools on the table of bayesian
statistics to use. 

## The Dirichlet Distribution

The [Dirichet distribution](https://en.wikipedia.org/wiki/Dirichlet_distribution) can be
used to model the probability of a set of discrete possibilities---depositional
environments, in this context. The Dirichlet distribution samples from a simplex (a
vector of numbers that add to 1), which makes it perfect for modelling our uncertainty
over interpretations, where we assign some probability to each.

It also has the convenient property of conjugacy, which essentially means it is very
easy to go from prior to posterior, which will be an important part of this process.

## Applied to a Simple Example

Say we are considering three depositional environments when looking at part of an
outcrop:

1. Delta 
2. Turbidite 
3. Lake

The $\alpha$ parameter of the distribution can be thought of as a list of weights or
"pseudocounts", one for each possibility.

In this case let's say we assign our weights as:

$$
\alpha = [50, 25, 1]
$$

This equates to us saying that we think the Delta interpretation is most
plausible, although the Turbidite interpretation is a possibility, while the Lake
interpretation is implausible.

That results in the following distribution:

::: {#7e8de757 .cell execution_count=2}
``` {.python .cell-code}
sims = 1000
alpha = [50, 25, 1]

simdata = np.random.dirichlet(alpha, size=sims)

df = pd.DataFrame({
    "P(Delta)": simdata[:, 0],
    "P(Turbidite)": simdata[:, 1],
    "P(Lake)": simdata[:, 2],
}).melt(var_name="Interpretation", value_name="Probability")

def plot_dirichlet_histogram(df: pd.DataFrame, title: str) -> alt.Chart:
    tick_values = [round(i * 0.1, 1) for i in range(11)]
    return (
        alt.Chart(df)
        .mark_bar(opacity=0.5)
        .encode(
            alt.X(
                "Probability:Q", 
                bin=alt.Bin(maxbins=100),
                scale=alt.Scale(domain=[0, 1]),
                axis=alt.Axis(values=tick_values)
            ),
            alt.Y(
                "count():Q", 
                stack=None,
                title='',
                axis=alt.Axis(
                    labels=False, 
                    ticks=False, 
                    grid=False, 
                    domain=False
                )
            ),

            alt.Color(
                "Interpretation:N",
                legend=alt.Legend(orient="top-right")
            ),
            alt.Order("Interpretation:N")
        )
        .properties(
            title=title,
            height=PLOT_HEIGHT,
            width=PLOT_WIDTH
        )
    )

chart = plot_dirichlet_histogram(df, title="Interpretation Probabilities")
chart.show()
```

